import React from "react";
import classes from "./NavigationBar.module.css";

const NavigationBar = () => {
  return (
    <nav className={classes.navbar}>
      <li>START BOOTSTRAP</li>
      <li>PORTFOLIO</li>
      <li>ABOUT</li>
      <li>CONTACT</li>
    </nav>
  );
};

export default NavigationBar;
